contracts/LAND/Storage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0<=0.7.6;

import "./LANDStorage.sol";
import "./AssetRegistryStorage.sol";
import "./OwnableStorage.sol";
import "./ProxyStorage.sol";


contract Storage is LANDStorage, AssetRegistryStorage, OwnableStorage, ProxyStorage {}

contracts/LAND/ProxyStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0<=0.7.6;

contract ProxyStorage {
    address public currentContract;
    address public proxyOwner;
}

contracts/LAND/OwnableStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0<=0.7.6;

abstract contract OwnableStorage {
    address public owner;

    constructor() {
        owner = msg.sender;
    }
}

contracts/LAND/AssetRegistryStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0<=0.7.6;

contract AssetRegistryStorage {
    string internal _name;
    string internal _symbol;
    string internal _description;

    //Stores the total count of assets managed by this registry
    uint256 internal _count;

    // Stores an array of assets owned by a given account
    mapping(address => uint256[]) internal _assetsOf;

    // Stores the current holder of an asset
    mapping(uint256 => address) internal _holderOf;

    // Stores the index of an asset in the `_assetsOf` array of its holder
    mapping(uint256 => uint256) internal _indexOfAsset;

    // Stores the data associated with an asset
    mapping(uint256 => string) internal _assetData;

    // For a given account, for a given operator, store whether that operator is allowed to transfer and modify assets on behalf of them.
    mapping(address => mapping(address => bool)) internal _operators;

    // Approval array
    mapping(uint256 => address) internal _approval;
}

contracts/LAND/LANDStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0<=0.7.6;

contract LANDStorage {
    mapping (address => uint) public latestPing;

    uint256 constant clearLow = 0xffffffffffffffffffffffffffffffff00000000000000000000000000000000;
    uint256 constant clearHigh = 0x00000000000000000000000000000000ffffffffffffffffffffffffffffffff;
    uint256 constant factor = 0x100000000000000000000000000000000;

    mapping (address => bool) public authorizedDeploy;
}
